// Example for Dictionary usage\nvar myDict = new Dictionary<int, string>();\n// Populate dictionary...\nstring result;\nbool found = myDict.TryGetValue(someKey, out result); // Fast O(1) lookup\n\n// Example for ConcurrentDictionary usage\nvar myConcurrentDict = new ConcurrentDictionary<int, string>();\n// Populate concurrent dictionary...\nresult = myConcurrentDict.GetOrAdd(someKey, k => someValueFunction(k)); // Thread-safe operations